import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Header from "./Header"; 
import { Link,useNavigate } from 'react-router-dom';
import { BASE_URL } from '../fetchApi'; 

const Questions = () => {
  const base_url = BASE_URL;

  const [question, setQuestion] = useState("");
  const [options, setOptions] = useState(["", "", "", ""]);
  const [correctAnswer, setCorrectAnswer] = useState("");

  const navigate = useNavigate();

  const handleOptionChange = (index, value) => {
    const newOptions = [...options];
    newOptions[index] = value;
    setOptions(newOptions);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = {
      question,
      options,
      correctAnswer,
      created_by: 1,
    };

    try {
      //const token = localStorage.getItem("token"); // Assuming the token is stored in localStorage
      //console.log('hello');
      // const data_json = JSON.stringify(data);
      // console.log(data_json);
      const response = await fetch(`${base_url}/questions/add`, {
        method: "POST",
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(data),
      });

      if (!response.ok) {
        throw new Error(`Error: ${response.statusText}`);
      }

      const result = await response.json();

      const msg = result.msg;
      //alert(`Frage hinzugefÃ¼gt: ${result.msg}`);

      navigate('/frageerfolgreich',{state: {msg}});

    } catch (error) {
      console.log(error);
    }
  };

  // const handleSubmit = async (e) => {
  //   // const result = {
  //   //   question,
  //   //   options,
  //   //   correctAnswer,
  //   //   created_by: 1
  //   // };
  //   const msg = "Question: "+question+" added successfully";
  //   //alert(msg);
  //   navigate("/frageerfolgreich",{ state: {msg} });
  // };

  return (
    <div className="container-fluid px-0">
      {/* Header */}
      <Header />

      {/* Hauptcontainer */}
      <div className="d-flex flex-column align-items-center bg-light min-vh-100 pt-4">
        <div className="card p-4 shadow-sm" style={{ width: "50%" }}>
          <h2 className="text-center">Neue Fragen hinzufÃ¼gen</h2>
          <p>FÃ¼ge eine Frage mit Single-Choice-Antworten hinzu, die im Quiz verwendet werden kann.</p>

          <form onSubmit={handleSubmit}>
            {/* Eingabefeld fÃ¼r die Frage */}
            <div className="mb-3">
              <label htmlFor="frage" className="form-label">Frage</label>
              <input
                type="text"
                id="frage"
                className="form-control"
                placeholder="Gib hier deine Frage ein"
                value={question}
                onChange={(e) => setQuestion(e.target.value)}
                required
              />
            </div>

            {/* AntwortmÃ¶glichkeiten */}
            <p>AntwortmÃ¶glichkeiten</p>
            {options.map((option, index) => (
              <div key={index} className="d-flex align-items-center mb-2">
                <input type="radio" name="antwort" disabled className="me-2" />
                <input
                  type="text"
                  className="form-control"
                  placeholder={`Antwort ${index + 1}`}
                  value={option}
                  onChange={(e) => handleOptionChange(index, e.target.value)}
                  required
                />
              </div>
            ))}

            {/* Auswahl fÃ¼r die richtige Antwort */}
            <div className="mb-3">
            <label htmlFor="richtige-antwort" className="form-label">Korrekte Antwort</label>
            <select
             id="richtige-antwort"
             className="form-select"
             value={correctAnswer}
             onChange={(e) => setCorrectAnswer(e.target.value)}
             required
          >
             <option value="" disabled>WÃ¤hle eine Antwort</option>
             {options.map((option, index) => (
             <option key={index} value={option}>
               Antwort {index + 1}
             </option>
          ))}
             </select>
          </div>

            {/* Speichern-Button */}
            <div className="text-center">
              <button type="submit" className="btn btn-primary">Frage speichern</button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Questions;
